import React from "react";
import "./style.css";
import { Link } from "react-router-dom";
import houses from "./houses";

const Home = () => {
  // Function to render house cards
  const renderHouseList = () => {
    return houses.map((house, index) => (
      <div key={index} className="col-sm-10 col-md-5 col-lg-3 col-xl-3 card">
        <Link
          to={`/houseDetails/${index}`}
          className="text-reset text-decoration-none"
          target="_blank"
        >
          <img src={house.img} className="card-img-top" alt={house.name} />
          <div className="card-body">
            <div className="card-content">
              <h5>{house.name}</h5>
              <p>{house.desp}</p>
            </div>
            <div className="card-btn text-end">
              <Link
                to={`/houseDetails/${index}`}
                className="btn btn-outline-dark"
                target="_blank"
              >
                Visit
              </Link>
            </div>
          </div>
        </Link>
      </div>
    ));
  };

  return (
    <main className="col-sm-12 col-md-12 col-lg-12 col-xl-12 main p-5">
      <div className="col-sm-12 col-md-12 col-lg-12 col-xl-12 text-center title-text">
        A complete solution for Planning & Designing your dream Home
      </div>
      <div className="container input-group search-input mt-4 mb-5">
        <input
          type="text"
          className="form-control border border-dark"
          placeholder="Enter your requirements..."
          aria-label="Enter your requirements..."
          aria-describedby="button-addon2"
        />
        <button className="btn bg-light input-group-append" type="button" id="button-addon2">
          <i className="fa fa-search"></i>
        </button>
      </div>
      <div className="col-sm-12 col-md-12 col-lg-12 col-xl-12 d-flex justify-content-center px-4">
        <div className="row">

        </div>
        
      </div>

      <div id="houseContainer" className="row"></div>

      <div className="container col-sm-12 col-md-12 col-lg-12 col-xl-12">
        <h3 className="pt-5">Popular Designs</h3>
        <div
          className="row gx-0 gap-5 mt-3 mx-auto justify-content-center"
          id="houseList"
        >
          {renderHouseList()}
        </div>
      </div>
    </main>
  );
};

export default Home;
